import Vue from 'vue'
import Router from 'vue-router'
import Login from '@/pages/Login'
import Home from '@/pages/Home'
import ShopList from '@/pages/ShopList'
import AddShop from '@/pages/AddShop'
Vue.use(Router)
export default new Router({
    routes:[
        {
            path:'/',
            component: Login
        },
        {
            path: '/home',
            component: Home
        },
        {
            path: '/shopList',
            component: ShopList
        },
        {
            path: '/home/addShop/:id',
            component: AddShop
        },
        {
            path: '/home/addShop',
            component: AddShop
        },
    ]
})
